// src/components/VenueSelection.js
import React from 'react';
import './VenueSelection.css';

const VenueSelection = () => {
    return (
        <div className="service-page">
            <h1>Venue Selection</h1>
            <p>
                Choosing the right venue is one of the most important aspects of wedding planning. At WedSymphony, we offer venue selection services that take the stress out of this decision-making process. We help you find the perfect setting that aligns with your vision, whether it's a palace, beach, garden, or a heritage property.
            </p>
            <p>
                Services include:
                <ul>
                    <li>Venue Research and Shortlisting</li>
                    <li>Site Visits and Comparisons</li>
                    <li>Contract Negotiations</li>
                    <li>Venue Setup and Decoration Guidance</li>
                    <li>Guest and Parking Management</li>
                </ul>
            </p>
            <p>
                Let us help you find the perfect backdrop for your big day, ensuring that the venue matches your vision and makes your wedding day unforgettable.
            </p>
        </div>
    );
}

export default VenueSelection;
